INSERT INTO `csc_faq` VALUES ('6', '怎么注册？', '', '20', '0,2,,20,', '/uploads/article/cover/2017/03/14/13/10/e556caae2ed6be855c8137678b2457dd.jpg', '/uploads/article/cover/2017/03/14/13/10/e556caae2ed6be855c8137678b2457dd_thumb.jpg', '/uploads/article/cover/2017/03/14/13/10/e556caae2ed6be855c8137678b2457ddthumb_min.jpg', 'sfsdfsfsdfsfsfsdf<img src=\"/uploads/faq/content/2017/03/14/16/21/673cb12181965d705ab068144b219ff8.jpg\" alt=\"\" title=\"\" width=\"515\" height=\"290\" align=\"\" />                        ', '1', '0', '0', '2017-03-14 13:10:52');
INSERT INTO `csc_faq` VALUES ('7', '收不到验证码？', '', '22', '0,2,,22,', '', null, null, '<p style=\"text-indent:2em;\">\r\n	<span style=\"font-size:16px;font-family:Microsoft YaHei;color:#999999;line-height:1.5;\">1、用户自己手机号码被运营商屏蔽你曾将此类通知短信向运营商投诉为垃圾短信，使得短信被运营商屏蔽。</span><br />\r\n<span style=\"font-size:16px;font-family:Microsoft YaHei;color:#999999;line-height:1.5;\"> 解决方法：需要你联系运营商解决此问题</span> \r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n	<span style=\"font-size:16px;font-family:Microsoft YaHei;color:#999999;line-height:1.5;\">2、 手机短信安全软件等黑名单设置\r\n        您曾经在手机短信中设置了比较严苛拦截的拦截规则。\r\n        解决方法： 查看短信黑名单设置，菜单->骚扰拦截->设置，分别查看拦截模式与黑白明单是否有不允许短信到达的号码。</span> \r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n	<span style=\"font-size:16px;font-family:Microsoft YaHei;color:#999999;line-height:1.5;\">3、手机内部浏览器隐私设置\r\n        浏览器设置安全等级过高或者设置了阻止“第三方Cookie和网站数据”的设置。\r\n        解决方法：重新设置浏览器安全等级或者关闭浏览器“阻止第三方Cookie”的设置，设置->隐私设置->内容设置。</span> \r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n	<br />\r\n</p>', '0', '0', '0', '2017-03-14 17:00:51');
