  `end_time` date DEFAULT NULL COMMENT '结束日期',
  `url` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT '广告链接',
  `is_show` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT '是否显示',
  `sort` int(11) DEFAULT '0' COMMENT '排序数字 默认0',
