  `img_url` varchar(1024) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '图片URL链接',
  `flash` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'FLASH文件路径',
