  `text` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '文字广告内容',
  `contactor` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '广告联系人',
  `email` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '联系人Email',
  `phone` varchar(13) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '联系电话',
  `site_id` int(4) DEFAULT NULL COMMENT '站点编号',
  `relation_pos_id` char(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '关联广告位',
  `add_time` datetime NOT NULL COMMENT '发布日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='广告元信息表';

