-- Table structure for csc_cash
-- ----------------------------
DROP TABLE IF EXISTS `csc_cash`;
CREATE TABLE `csc_cash` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL COMMENT '用户名',
  `price` int(11) unsigned NOT NULL COMMENT '提现金额',
  `commision` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '手续费',
  `type` tinyint(4) NOT NULL COMMENT '提现方式 默认1 1银行转帐 2支付宝转帐',
  `blank_name` varchar(15) COLLATE utf8_unicode_ci NOT NULL COMMENT '开户行名称',
  `tname` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '户名/支付宝姓名',
  `account` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '银行卡号/支付宝帐号',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态 默认0 -1申请退回 0提交申请 1申请成功 2已完成',
  `add_time` datetime NOT NULL COMMENT '发布日期',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `add_time` (`add_time`),
  KEY `status` (`status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='提现信息表';

