-- Table structure for csc_category
-- ----------------------------
DROP TABLE IF EXISTS `csc_category`;
CREATE TABLE `csc_category` (
  `id` int(11) NOT NULL,
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '名称',
  `in_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '导入分类名称',
  `logo` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '分类logo',
  `type` tinyint(4) NOT NULL COMMENT '暂时无效 16-7-26 lcr',
  `pinyin` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '英文描述',
  `special_id` tinyint(4) DEFAULT NULL COMMENT '暂时无效 16-7-26 lcr',
  `link` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '绑定链接',
  `is_show` char(1) COLLATE utf8_unicode_ci DEFAULT '1' COMMENT '是否显示 默认为1 0 不显示 1显示',
  `is_recom` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否推荐 默认0',
  `parent_id` int(11) NOT NULL COMMENT '父级分类ID 顶级分类为 0',
  `cate_path` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT '分类路径',
  `sort` int(11) DEFAULT '1' COMMENT '排序数字 默认为1',
  `attr_filter` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '筛选属性 多个逗号隔开',
  `add_time` datetime NOT NULL COMMENT '创建时间',
  `import_id` int(11) DEFAULT NULL COMMENT '导入分类编号',
  `area_sort` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '区间排序数字',
  `area_sort_time` datetime DEFAULT NULL COMMENT '分类区间修改时间',
  `relation_cate_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联分类',
  `service` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '产品服务',
  PRIMARY KEY (`id`),
  KEY `pinyin` (`pinyin`),
  KEY `sort` (`sort`),
  KEY `cate_path` (`cate_path`),
  KEY `parent_id` (`parent_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='分类信息表';

