-- ----------------------------
-- Table structure for csc_coupon
-- ----------------------------
DROP TABLE IF EXISTS `csc_coupon`;
CREATE TABLE `csc_coupon` (
  `id` int(5) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(60) COLLATE utf8_unicode_ci NOT NULL COMMENT '名称',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '抵扣金额',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '发送方式 0用户 1部分用户 2注册 3订单金额(购买) 4分享有礼 5生日 6积分兑换',
  `min_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '订单最小金额',
  `order_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单金额',
  `send_start_date` datetime NOT NULL COMMENT '发放开始日期',
  `send_end_date` datetime NOT NULL COMMENT '发放结束日期',
  `use_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '使用期限类型 1指定时间内有效 2立即生效',
  `use_start_date` date DEFAULT NULL COMMENT '使用开始日期',
  `use_end_date` date DEFAULT NULL COMMENT '使用结束日期',
  `use_day` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '使用有效期时长 单位:天',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '审核状态 -1审核不通过 0待审核 1审核通过；',
  `remark` text COLLATE utf8_unicode_ci COMMENT '备注',
  `send_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '发放状态，只针对类型为0优惠券',
  `send_time` datetime DEFAULT NULL COMMENT '上一次发放时间',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='优惠券类型信息表';

