-- ----------------------------
-- Table structure for csc_coupon_cron
-- ----------------------------
DROP TABLE IF EXISTS `csc_coupon_cron`;
CREATE TABLE `csc_coupon_cron` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `coupon_id` int(11) NOT NULL COMMENT '优惠券编号(生日/用户类型的优惠券才能加入)',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '执行状态-1失败 0未执行 1执行中 2已执行',
  `perform_time` datetime DEFAULT NULL COMMENT '执行完成时间',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='优惠券批量发放任务信息';

-- ----------------------------
-- Records of csc_coupon_cron
