-- ----------------------------
-- Table structure for csc_delivery_goods
-- ----------------------------
DROP TABLE IF EXISTS `csc_delivery_goods`;
CREATE TABLE `csc_delivery_goods` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `delivery_id` int(11) unsigned NOT NULL COMMENT '发货单ID',
  `order_id` varchar(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单编号',
  `order_goods_id` int(11) NOT NULL COMMENT '订单商品编号',
  `num` tinyint(4) NOT NULL COMMENT '发货数量',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `delivery_id` (`delivery_id`)
) ENGINE=InnoDB AUTO_INCREMENT=77 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='发货单详情表';

-- ----------------------------
-- Records of csc_delivery_goods
-- ----------------------------

-- ----------------------------
-- Table structure for csc_delivery_order
-- ----------------------------
DROP TABLE IF EXISTS `csc_delivery_order`;
CREATE TABLE `csc_delivery_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `delivery_sn` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '发货单号',
  `order_id` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单号',
  `invoice_no` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '运单号',
  `shipping_id` tinyint(3) unsigned DEFAULT '0' COMMENT '快递公司编号',
  `shipping_code` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '配送代码',
  `shipping_name` varchar(120) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '快递公司名称',
  `user_id` int(11) unsigned DEFAULT '0' COMMENT '用户编号',
  `action_user` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '操作员',
  `consignee` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '收件人',
  `address` varchar(250) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '收件地址',
  `province_id` int(11) unsigned DEFAULT '0' COMMENT '省份ID',
  `city_id` int(11) unsigned DEFAULT '0' COMMENT '城市ID',
  `area_id` int(11) unsigned DEFAULT '0' COMMENT '地区ID',
  `zipcode` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '收件人地区邮编',
  `tel` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '收件人电话',
  `id_card` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '身份证',
  `ship_time` datetime DEFAULT NULL COMMENT '发货时间',
  `update_time` datetime DEFAULT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '发货状态 -1已取消 0待发货 10备货中 20发货中 30已发货(待收货) 40已签收',
  `ware_id` int(11) DEFAULT '0' COMMENT '仓库id',
  `remark` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '生成发货单 的备注',
  `logistics_trace` text COLLATE utf8_unicode_ci COMMENT '物流跟踪',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `delivery_sn` (`delivery_sn`),
  KEY `order_id` (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=53 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='发货单信息表';

-- ----------------------------
-- Records of csc_delivery_order
-- ----------------------------

-- ----------------------------
-- Table structure for csc_factory
-- ----------------------------
DROP TABLE IF EXISTS `csc_factory`;
CREATE TABLE `csc_factory` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '名称',
  `subname` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '副标题',
  `img` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '封面图片',
  `description` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '简介',
  `content` text CHARACTER SET utf8 COLLATE utf8_unicode_ci COMMENT '详细介绍',
  `sort` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '排序数字',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `sort` (`sort`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='工厂信息';

-- ----------------------------
-- Records of csc_factory
-- ----------------------------

-- ----------------------------
-- Table structure for csc_faq
-- ----------------------------
DROP TABLE IF EXISTS `csc_faq`;
CREATE TABLE `csc_faq` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '标题',
  `link` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '外部链接',
  `cate_id` int(11) NOT NULL COMMENT '分类ID',
  `cate_path` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT '分类路径',
  `img` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `img_thumb` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `thumb_min` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `content` text COLLATE utf8_unicode_ci COMMENT '信息内容',
  `sort` int(11) DEFAULT '0' COMMENT '排序数字 默认0',
  `clickcount` int(11) DEFAULT '0' COMMENT '点击量',
  `is_system` tinyint(1) unsigned DEFAULT '0' COMMENT '1 系统级别 只能修改不能删除 0 普通 可编辑可删',
  `add_time` datetime NOT NULL COMMENT '发布日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='FAQ信息表';

-- ----------------------------
-- Records of csc_faq
-- ----------------------------

-- ----------------------------
-- Table structure for csc_feedback
-- ----------------------------
DROP TABLE IF EXISTS `csc_feedback`;
CREATE TABLE `csc_feedback` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` enum('0','1','2') COLLATE utf8_unicode_ci NOT NULL COMMENT '0意见反馈 1订单举报 2直购商品订购提醒',
  `user_id` int(11) DEFAULT NULL COMMENT '用户ID',
  `guest_ip` char(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '来源IP',
  `content` text COLLATE utf8_unicode_ci NOT NULL COMMENT '反馈意见',
  `report_user_id` int(11) DEFAULT NULL COMMENT '被举报用户编号',
  `order_id` char(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '订单编号',
  `store_id` int(11) DEFAULT NULL COMMENT '店铺ID',
  `goods_id` int(11) DEFAULT NULL COMMENT '商品id',
  `img_list` varchar(1200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '图片列表 多个逗号隔开',
  `add_time` datetime NOT NULL COMMENT '发布日期',
  PRIMARY KEY (`id`),
  KEY `csc_create` (`add_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='意见反馈信息表';

-- ----------------------------
-- Records of csc_feedback
-- ----------------------------

-- ----------------------------
-- Table structure for csc_finance_log
-- ----------------------------
DROP TABLE IF EXISTS `csc_finance_log`;
CREATE TABLE `csc_finance_log` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` varchar(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '业务单号',
  `type` tinyint(4) NOT NULL COMMENT '财务类型 1正常下单 2退款 3退货 4换货',
  `pay_code` enum('alipay','wxpay','wxpay_mp','xingwang','coupon','balance') COLLATE utf8_unicode_ci NOT NULL COMMENT '付款类型 alipay支付宝 wxpay,wxpay_mp微信 xingwang银行卡 coupon优惠券 balance余额',
  `price` decimal(10,2) NOT NULL COMMENT '金额',
  `remark` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `type` (`type`),
  KEY `pay_code` (`pay_code`),
  KEY `add_time` (`add_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='财务日志明细表';

-- ----------------------------
-- Records of csc_finance_log
-- ----------------------------

-- ----------------------------
-- Table structure for csc_flow
-- ----------------------------
DROP TABLE IF EXISTS `csc_flow`;
CREATE TABLE `csc_flow` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `platform` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '平台标识',
  `url` varchar(500) COLLATE utf8_unicode_ci NOT NULL COMMENT '请求地址',
  `user_id` int(11) unsigned DEFAULT NULL COMMENT '用户ID',
  `ip` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '客户端IP',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  `m` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '汇总月份',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=36096 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='终端流量信息';

-- ----------------------------
-- Records of csc_flow
