-- ----------------------------
-- Table structure for csc_flow_memory
-- ----------------------------
DROP TABLE IF EXISTS `csc_flow_memory`;
CREATE TABLE `csc_flow_memory` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `platform` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '平台标识',
  `url` varchar(500) COLLATE utf8_unicode_ci NOT NULL COMMENT '请求地址',
  `user_id` int(11) unsigned DEFAULT NULL COMMENT '用户ID',
  `ip` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '客户端IP',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=MEMORY DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='终端流量信息';

