-- ----------------------------
-- Table structure for csc_goods
-- ----------------------------
DROP TABLE IF EXISTS `csc_goods`;
CREATE TABLE `csc_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品ID 主键',
  `cate_id` int(11) NOT NULL COMMENT '分类ID',
  `cate_path` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT '分类路径',
  `brand_id` int(11) NOT NULL DEFAULT '0' COMMENT '品牌编号',
  `goods_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '名称',
  `sub_name` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '副标题',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '商品类型 默认0 0普通商品 1工厂直购',
  `market_price` double DEFAULT NULL COMMENT '市场价',
  `price` double NOT NULL COMMENT '购买价',
  `event_price` double NOT NULL DEFAULT '0' COMMENT '活动价 默认0',
  `event_start_date` datetime DEFAULT NULL COMMENT '活动开始日期',
  `event_end_date` datetime DEFAULT NULL COMMENT '活动结束日期',
  `stock` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '库存 默认0',
  `warn_number` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '库存警告数',
  `free_maill` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否包邮 默认0',
  `img_home` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '首页展示图片',
  `img_thumb` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '中等缩略图片路径',
  `earn` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '赚多少钱',
  `is_add` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否上架 默认1  -1 禁售 0已下架 1 已上架',
  `reason` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '下架/禁售原因',
  `is_cash` int(2) NOT NULL DEFAULT '1' COMMENT '是否支持货到付款 1支持 0不支持',
  `is_alone_sale` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否允许单独销售',
  `is_coupon` tinyint(1) DEFAULT '1' COMMENT '是否可以使用优惠券，0：不能使用；1：可以使用',
  `is_refund` tinyint(3) DEFAULT '1' COMMENT '是否可以退货，0：不可以；1可以',
  `is_exchange` tinyint(3) DEFAULT '1' COMMENT '是否可以换货，0：不可以；1：可以',
  `is_hot` tinyint(1) unsigned DEFAULT '0' COMMENT '是否推荐',
  `spec_name_one` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '规格一名称',
  `spec_name_two` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '规格二名称',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序数字 默认为0',
  `factory_id` int(11) DEFAULT NULL COMMENT '工厂编号',
  `is_del` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除',
  `last_modify` datetime DEFAULT NULL COMMENT '最后修改时间',
  `add_time` datetime NOT NULL COMMENT '发布日期',
  PRIMARY KEY (`id`),
  KEY `is_alone_sale` (`is_alone_sale`),
  KEY `is_del` (`is_del`),
  KEY `is_add` (`is_add`),
  KEY `goods_name` (`goods_name`),
  KEY `sort` (`sort`),
  KEY `cate_id` (`cate_id`),
  KEY `cate_path` (`cate_path`),
  KEY `is_hot` (`is_hot`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=52 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='商品信息表';

-- ----------------------------
-- Records of csc_goods
-- ----------------------------

-- ----------------------------
-- Table structure for csc_goods_album
-- ----------------------------
DROP TABLE IF EXISTS `csc_goods_album`;
CREATE TABLE `csc_goods_album` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) NOT NULL COMMENT '商品ID',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '图片类型 默认0 0图片 1视频',
  `img` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '原图图片路径',
  `img_thumb` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '中等缩略图片路径',
  `thumb_min` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '最小缩略图片路径',
  `video` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '视频播放地址',
  `sort` int(11) DEFAULT '0' COMMENT '排序数字 默认为0',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `sort` (`sort`)
) ENGINE=InnoDB AUTO_INCREMENT=120 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='商品相册信息表';

-- ----------------------------
-- Records of csc_goods_album
-- ----------------------------

-- ----------------------------
-- Table structure for csc_goods_attr
-- ----------------------------
DROP TABLE IF EXISTS `csc_goods_attr`;
CREATE TABLE `csc_goods_attr` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `goods_id` int(11) NOT NULL COMMENT '商品ID',
  `attr_type_id` int(11) NOT NULL COMMENT '属性类型编号',
  `attr_filter_id` int(11) NOT NULL COMMENT '筛选属性编号',
  `attr_name` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '属性名称',
  `attr_value` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '属性值',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序数字 默认为0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='商品筛选属性信息表';

-- ----------------------------
-- Records of csc_goods_attr
-- ----------------------------

-- ----------------------------
-- Table structure for csc_goods_comment
-- ----------------------------
DROP TABLE IF EXISTS `csc_goods_comment`;
CREATE TABLE `csc_goods_comment` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `goods_id` int(11) NOT NULL COMMENT '商品ID',
  `store_id` int(11) DEFAULT NULL COMMENT '店铺ID',
  `user_id` int(11) NOT NULL COMMENT '用户ID',
  `order_id` int(11) DEFAULT NULL COMMENT '订单ID',
  `author` tinyint(4) NOT NULL DEFAULT '0' COMMENT '审核 默认0 0 未审核 1 已审核',
  `content` varchar(1024) COLLATE utf8_unicode_ci NOT NULL COMMENT '评论内容',
  `is_sd` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否晒单 默认0',
  `star_level` tinyint(4) NOT NULL DEFAULT '1' COMMENT '星级默认1 ',
  `img` varchar(800) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '图片路径',
  `replay` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '管理员回复内容',
  `replay_time` datetime DEFAULT NULL COMMENT '回复时间',
  `add_time` datetime NOT NULL COMMENT '发布日期',
  PRIMARY KEY (`id`),
  KEY `csc_store_id` (`store_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='商品评论信息表';

-- ----------------------------
-- Records of csc_goods_comment
-- ----------------------------

-- ----------------------------
-- Table structure for csc_goods_comm_label
-- ----------------------------
DROP TABLE IF EXISTS `csc_goods_comm_label`;
CREATE TABLE `csc_goods_comm_label` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `goods_id` int(11) NOT NULL COMMENT '商品ID',
  `label` int(11) NOT NULL COMMENT '评论标签标号',
  `num` int(11) NOT NULL DEFAULT '0' COMMENT '评论数量 默认0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='商品评论标签信息表';

-- ----------------------------
-- Records of csc_goods_comm_label
-- ----------------------------

-- ----------------------------
-- Table structure for csc_goods_ext
-- ----------------------------
DROP TABLE IF EXISTS `csc_goods_ext`;
CREATE TABLE `csc_goods_ext` (
  `goods_id` int(11) NOT NULL COMMENT '商品ID 主键',
  `collect_num` int(11) NOT NULL DEFAULT '0' COMMENT '收藏数量 默认为0',
  `order_num` int(11) NOT NULL DEFAULT '0' COMMENT '下单数量 默认为0',
  `sale_num` int(11) NOT NULL DEFAULT '0' COMMENT '已售数量 默认为0',
  `virtual_num` int(11) NOT NULL DEFAULT '0' COMMENT '虚拟销量',
  `visit_num` int(11) NOT NULL DEFAULT '0' COMMENT '访问数量 默认为0',
  `comment_num` int(11) DEFAULT '0' COMMENT '评论数量 默认为0',
  `hp_num` int(11) DEFAULT '0' COMMENT '好评数量 默认为0',
  `zp_num` int(11) DEFAULT '0' COMMENT '中评数量 默认为0',
  `cp_num` int(11) DEFAULT '0' COMMENT '差评数量 默认为0',
  `sd_num` int(11) DEFAULT '0' COMMENT '晒单数量 默认为0',
  PRIMARY KEY (`goods_id`)
