-- Records of csc_goods_ext_cate
-- ----------------------------

-- ----------------------------
-- Table structure for csc_goods_gift
-- ----------------------------
DROP TABLE IF EXISTS `csc_goods_gift`;
CREATE TABLE `csc_goods_gift` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) NOT NULL COMMENT '商品编号',
  `gift_goods_id` int(11) NOT NULL COMMENT '赠品编号',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='商品赠品信息表';

-- ----------------------------
-- Records of csc_goods_gift
-- ----------------------------

-- ----------------------------
-- Table structure for csc_goods_info
-- ----------------------------
DROP TABLE IF EXISTS `csc_goods_info`;
CREATE TABLE `csc_goods_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) unsigned NOT NULL COMMENT '商品编号',
  `goods_param` text COLLATE utf8_unicode_ci COMMENT '商品参数',
  `description` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '简介',
  `content` text COLLATE utf8_unicode_ci NOT NULL COMMENT '商品详情',
  PRIMARY KEY (`id`),
  UNIQUE KEY `goods_id` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=46 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='商品扩展信息表';

-- ----------------------------
-- Records of csc_goods_info
-- ----------------------------

-- ----------------------------
-- Table structure for csc_goods_spec
-- ----------------------------
DROP TABLE IF EXISTS `csc_goods_spec`;
CREATE TABLE `csc_goods_spec` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `goods_id` int(11) NOT NULL COMMENT '商品ID',
  `goods_sn` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '型号',
  `barcode` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '条码',
  `sku` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '内部码',
  `market_price` double DEFAULT NULL COMMENT '市场价',
  `price` double NOT NULL COMMENT '购买价',
  `event_price` double NOT NULL DEFAULT '0' COMMENT '活动价 默认0',
  `event_start_date` datetime DEFAULT NULL COMMENT '活动开始日期',
  `event_end_date` datetime DEFAULT NULL COMMENT '活动结束日期',
  `stock` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '库存 默认0',
  `warn_number` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '库存警告数',
  `gift_score` int(11) NOT NULL DEFAULT '0' COMMENT '赠送积分 默认0',
  `sale_limit` int(11) unsigned DEFAULT '0' COMMENT '用户购买数量限制 0不限制',
  `earn` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '赚多少钱',
  `spec_one` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '规格一',
  `spec_two` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '规格二',
  `img` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '原图图片路径',
  `img_thumb` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '中等缩略图片路径',
  `thumb_min` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '最小缩略图片路径',
  `is_enable` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否启用',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=73 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='商品规格信息表';

-- ----------------------------
-- Records of csc_goods_spec
-- ----------------------------

-- ----------------------------
-- Table structure for csc_jiguang_queue
-- ----------------------------
DROP TABLE IF EXISTS `csc_jiguang_queue`;
CREATE TABLE `csc_jiguang_queue` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '消息标题',
  `msg` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '内容',
  `page_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '消息跳转方式',
  `url` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '网页链接',
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品编号',
  `order_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '订单编号',
  `client_id` text CHARACTER SET utf8 COLLATE utf8_unicode_ci COMMENT '客户端ID列表',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '执行状态-1失败 0未执行 1执行中 2已执行',
  `error_num` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '错误次数',
  `send_result` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '执行结果',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `status` (`status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='个推消息队列信息表';

-- ----------------------------
-- Records of csc_jiguang_queue
-- ----------------------------

-- ----------------------------
-- Table structure for csc_mail_queue
-- ----------------------------
DROP TABLE IF EXISTS `csc_mail_queue`;
CREATE TABLE `csc_mail_queue` (
  `csc_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `csc_mail_to` varchar(150) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '收件人',
  `csc_mail_encoding` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '邮件编码',
  `csc_mail_subject` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '邮件主题',
  `csc_mail_body` text COLLATE utf8_unicode_ci NOT NULL COMMENT '邮件内容',
  `csc_priority` tinyint(1) unsigned NOT NULL DEFAULT '2' COMMENT '优先级别',
  `csc_err_num` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '错误次数',
  `csc_add_time` datetime NOT NULL COMMENT '添加时间',
  `csc_lock_expiry` datetime NOT NULL COMMENT '待发送',
  PRIMARY KEY (`csc_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='邮件发送队列信息表';

-- ----------------------------
-- Records of csc_mail_queue
-- ----------------------------

-- ----------------------------
-- Table structure for csc_notice
-- ----------------------------
DROP TABLE IF EXISTS `csc_notice`;
CREATE TABLE `csc_notice` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '消息标题',
  `content` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT '内容',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '类型 0公告 1订单 2培训',
  `user_id` int(11) unsigned DEFAULT '0' COMMENT '用户编号',
  `order_id` char(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '关联订单',
  `url` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '页面地址',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `type` (`type`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='消息信息表';

-- ----------------------------
-- Records of csc_notice
-- ----------------------------

-- ----------------------------
-- Table structure for csc_notice_read
-- ----------------------------
DROP TABLE IF EXISTS `csc_notice_read`;
CREATE TABLE `csc_notice_read` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL COMMENT '用户编号',
  `notice_id` int(11) unsigned NOT NULL COMMENT '消息编号',
  `add_time` datetime NOT NULL COMMENT '阅读时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `notice_id` (`notice_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='消息阅读统计表';

