-- Records of csc_notice_read
-- ----------------------------

-- ----------------------------
-- Table structure for csc_oper_log
-- ----------------------------
DROP TABLE IF EXISTS `csc_oper_log`;
CREATE TABLE `csc_oper_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户ID',
  `username` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户名',
  `log` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT '操作日志',
  `guest_ip` char(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '客户端IP',
  `add_time` datetime NOT NULL COMMENT '发布日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=294 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='操作日志信息表';

-- ----------------------------
-- Records of csc_oper_log
-- ----------------------------

-- ----------------------------
-- Table structure for csc_order
-- ----------------------------
DROP TABLE IF EXISTS `csc_order`;
CREATE TABLE `csc_order` (
  `id` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '主键',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '类型 默认0  0普通订单 1推单订单',
  `parent_id` char(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '父订单编号',
  `push_user_id` int(11) NOT NULL DEFAULT '0' COMMENT '推单用户编号',
  `store_id` int(11) NOT NULL DEFAULT '0' COMMENT '店铺ID',
  `store_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '店铺名称',
  `user_id` int(11) NOT NULL COMMENT '用户ID',
  `buyer_phone` char(12) COLLATE utf8_unicode_ci NOT NULL COMMENT '购买用户电话',
  `buyer` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '购买者姓名',
  `buyer_email` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '购买者邮箱',
  `status` tinyint(4) DEFAULT '0' COMMENT '订单状态 默认0 -1 取消订单 0(已提交)待付款 10 已付款(待发货) 20 备货中 30发货中 40已发货(待收货) 50确认收货(已完成)',
  `pay_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '支付状 -1取消支付 0待支付 1已支付',
  `ship_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '发货状态默认0 0待发货 10备货中 20发货中 30已发货(待收货)',
  `refund_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '退款状态 0无 10已申请退款 20申请拒绝 30申请通过 40已退款',
  `goods_price` decimal(10,2) NOT NULL COMMENT '商品总价 单位: 元',
  `discount_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '折扣/满减/金额 单位: 元 默认0',
  `balance_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '余额支付金额',
  `coupon_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '优惠券金额',
  `freight_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '运费金额',
  `score_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '积分抵扣金额',
  `order_price` decimal(10,2) NOT NULL COMMENT '在线支付金额',
  `gift_score` int(11) NOT NULL DEFAULT '0' COMMENT '赠送积分 默认0',
  `pay_code` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '支付种类',
  `pay_no` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '交易串号',
  `pay_time` datetime DEFAULT NULL COMMENT '支付成功时间',
  `ship_time` datetime DEFAULT NULL COMMENT '发货时间',
  `confirm_time` datetime DEFAULT NULL COMMENT '确认收货时间',
  `is_del` tinyint(4) NOT NULL DEFAULT '0' COMMENT '删除订单 默认0 0未删除 1已删除 是否对用户显示',
  `order_msg` varchar(600) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '订单留言',
  `finance_msg` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '财务审核描述',
  `has_comment` tinyint(1) NOT NULL DEFAULT '0' COMMENT '订单是否完成评论',
  `exception_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '异常类型。0：默认没有异常；1：用户下单成功，未付款取消订单；2：用户付款付款成功，申请取消订单并退款；3：用户下单后，15分钟未付款，系统自动取消订单；4：客服手动在后台取消订单（用户下单后，未付款时）；5：客服手动在后台取消订单（用户下单并支付成功后）；6：售后时，客人申请退货；7：售后时，用户申请换货',
  `commision` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '提成 仅推单订单 计入个人',
  `commision_enable` tinyint(1) NOT NULL DEFAULT '0' COMMENT '收益生效 0未生效 1生效',
  `resorce` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '订单来源',
  `guest_ip` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '来源IP',
  `add_time` datetime NOT NULL COMMENT '发布日期',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `type` (`type`),
  KEY `push_user_id` (`push_user_id`),
  KEY `store_id` (`store_id`),
  KEY `status` (`status`),
  KEY `pay_status` (`pay_status`),
  KEY `add_time` (`add_time`),
  KEY `is_del` (`is_del`),
  KEY `commision_enable` (`commision_enable`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='订单信息表';

-- ----------------------------
-- Records of csc_order
-- ----------------------------

-- ----------------------------
-- Table structure for csc_order_coupon
-- ----------------------------
DROP TABLE IF EXISTS `csc_order_coupon`;
CREATE TABLE `csc_order_coupon` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单ID',
  `coupon_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '优惠券ID',
  `coupon_sn` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '优惠券编码',
  `name` varchar(60) COLLATE utf8_unicode_ci NOT NULL COMMENT '名称',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '抵扣金额',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '发送方式 0用户 1注册 2订单金额 3分享有礼 4生日 5免费送',
  `min_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '订单最小金额',
  `use_start_date` date NOT NULL COMMENT '使用开始日期',
  `use_end_date` date NOT NULL COMMENT '使用结束日期',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `add_time` (`add_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='订单优惠券信息表';

-- ----------------------------
-- Records of csc_order_coupon
-- ----------------------------

-- ----------------------------
-- Table structure for csc_order_goods
-- ----------------------------
DROP TABLE IF EXISTS `csc_order_goods`;
CREATE TABLE `csc_order_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `order_id` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单ID',
  `store_id` int(11) DEFAULT '0' COMMENT '商铺编号',
  `goods_id` int(11) NOT NULL COMMENT '商品ID',
  `spec_id` int(11) NOT NULL COMMENT '规格编号',
  `brand_id` int(11) DEFAULT NULL COMMENT '品牌编号',
  `brand_name` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '品牌名称',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '商品类型 默认0 0普通商品 1工厂直购',
  `goods_name` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT '商品名称',
  `sub_name` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '副标题',
  `goods_sn` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '型号',
  `barcode` varchar(64) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '条码',
  `sku` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '货号',
  `spec_name` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '规格名称',
  `market_price` decimal(10,2) DEFAULT NULL COMMENT '市场价',
  `price` decimal(10,2) NOT NULL COMMENT '价格',
  `event_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '活动价 默认0',
  `event_start_date` datetime DEFAULT NULL COMMENT '活动开始日期',
  `event_end_date` datetime DEFAULT NULL COMMENT '活动结束日期',
  `earn` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '赚多少钱',
  `trade_price` decimal(10,2) NOT NULL COMMENT '成交价 产品实际成交价(除去优惠及折扣)',
  `commision` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '提成 仅推单订单 计入个人',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT '兑换积分 默认0',
  `gift_score` int(11) NOT NULL DEFAULT '0' COMMENT '赠送积分 默认0',
  `num` tinyint(4) NOT NULL COMMENT '商品数量',
  `refund_num` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '退货数量',
  `thumb_min` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT '最小缩略图片路径',
  `comment_id` int(11) DEFAULT NULL COMMENT '评论编号',
  `free_maill` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否包邮 默认0',
  `sale_limit` int(11) unsigned DEFAULT '0' COMMENT '用户购买数量限制 0不限制',
  `is_cash` int(2) NOT NULL DEFAULT '1' COMMENT '是否支持货到付款 1支持 0不支持',
  `is_alone_sale` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否允许单独销售',
  `is_coupon` tinyint(1) DEFAULT '1' COMMENT '是否可以使用优惠券，0：不能使用；1：可以使用',
  `is_refund` tinyint(3) DEFAULT '1' COMMENT '是否可以退货，0：不可以；1可以',
  `is_exchange` tinyint(3) DEFAULT '1' COMMENT '是否可以换货，0：不可以；1：可以',
  `return_apply` tinyint(1) NOT NULL DEFAULT '0' COMMENT '退换货是否申请',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=50 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='订单商品信息表';

-- ----------------------------
-- Records of csc_order_goods
-- ----------------------------

-- ----------------------------
-- Table structure for csc_order_invoice
-- ----------------------------
DROP TABLE IF EXISTS `csc_order_invoice`;
CREATE TABLE `csc_order_invoice` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单编号',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '发票类类型 0不开票 1个人发票 2公司发票',
  `name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '发票抬头',
  `invoice_no` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '发票编号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_id` (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='订单发票信息表';

-- ----------------------------
-- Records of csc_order_invoice
-- ----------------------------

-- ----------------------------
-- Table structure for csc_order_log
-- ----------------------------
DROP TABLE IF EXISTS `csc_order_log`;
CREATE TABLE `csc_order_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `order_id` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单ID',
  `oper_name` varchar(15) COLLATE utf8_unicode_ci NOT NULL COMMENT '操作员',
  `order_status` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单状态',
  `change_status` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单改变状态',
  `remark` varchar(5000) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注',
  `add_time` datetime NOT NULL COMMENT '发布日期',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `add_time` (`add_time`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='单日志信息表';

-- ----------------------------
-- Records of csc_order_log
-- ----------------------------

-- ----------------------------
-- Table structure for csc_order_mail
-- ----------------------------
DROP TABLE IF EXISTS `csc_order_mail`;
CREATE TABLE `csc_order_mail` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `order_id` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单ID',
  `buyer_id` int(11) NOT NULL COMMENT '购买用户编号',
  `buyer_name` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '收货人姓名',
  `buyer_phone` char(12) COLLATE utf8_unicode_ci NOT NULL COMMENT '收货人电话',
  `id_card` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '身份证',
  `region_id` int(11) NOT NULL COMMENT '收货地区ID',
  `region_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '收货地址',
  `mail_id` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '邮递编号',
  `mail_code` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '配送代码',
  `mail_name` varchar(15) COLLATE utf8_unicode_ci NOT NULL COMMENT '邮递名称',
  `mail_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '邮递费用 默认0',
  `mail_info_up` text COLLATE utf8_unicode_ci COMMENT '收货信息变更记录json存储',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_id` (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='订单邮寄信息表';

-- ----------------------------
-- Records of csc_order_mail
-- ----------------------------

-- ----------------------------
-- Table structure for csc_pay_setting
-- ----------------------------
DROP TABLE IF EXISTS `csc_pay_setting`;
CREATE TABLE `csc_pay_setting` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `pay_code` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '支付标识',
  `pay_name` varchar(30) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '支付名称',
  `platform` enum('app','wx','pc','unline','xcs') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'app' COMMENT '适用平台标识',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '支付状态 , 0=关闭 , 1=开通',
  `ext_info` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展字段信息JSON格式 mm/lc:(key:字段名称,value:字段值)',
  `img` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '示例图片',
  `description` varchar(300) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '描述',
  `sort` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '排序 DESC',
  PRIMARY KEY (`id`),
  UNIQUE KEY `pay_code` (`pay_code`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='支付设置';

-- ----------------------------
-- Records of csc_pay_setting
-- ----------------------------

-- ----------------------------
-- Table structure for csc_power
-- ----------------------------
DROP TABLE IF EXISTS `csc_power`;
CREATE TABLE `csc_power` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `c_name` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '控制器名称  controller',
  `c_arlias` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '控制器别名(中文)',
  `a_name` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '方法名称 action',
  `a_arlias` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '方法别名(中文)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='权限信息';

-- ----------------------------
-- Records of csc_power
-- ----------------------------

-- ----------------------------
-- Table structure for csc_profit
-- ----------------------------
DROP TABLE IF EXISTS `csc_profit`;
CREATE TABLE `csc_profit` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `push_user_id` int(11) unsigned NOT NULL COMMENT '店主编号',
  `order_id` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单编号',
  `order_price` decimal(10,2) NOT NULL COMMENT '订单金额',
  `commision` decimal(10,2) NOT NULL COMMENT '收益金额',
  `cash_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '提现金额',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '类型 -1取消 0待确定 1确定',
  PRIMARY KEY (`id`),
  KEY `push_user_id` (`push_user_id`),
  KEY `type` (`type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='店主收益明细';

-- ----------------------------
-- Records of csc_profit
-- ----------------------------

-- ----------------------------
-- Table structure for csc_p_c_a
-- ----------------------------
DROP TABLE IF EXISTS `csc_p_c_a`;
CREATE TABLE `csc_p_c_a` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '名称',
  `pinyin` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '拼音',
  `type` enum('province','city','area') COLLATE utf8_unicode_ci NOT NULL COMMENT '类别 province city area',
  `parent_id` int(11) DEFAULT '0' COMMENT '父类id 默认为0',
  `code` varchar(6) COLLATE utf8_unicode_ci NOT NULL COMMENT '城市编号',
  `site` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否开通站点 默认0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3432 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='省份城市信息';

-- ----------------------------
-- Records of csc_p_c_a
-- ----------------------------

-- ----------------------------
-- Table structure for csc_rank_list
-- ----------------------------
DROP TABLE IF EXISTS `csc_rank_list`;
CREATE TABLE `csc_rank_list` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL COMMENT '用户编号',
  `user_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '姓名',
  `header_thumb` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '用户头像',
  `store_id` int(11) unsigned NOT NULL COMMENT '店铺编号',
  `store_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '店铺名称',
  `partment_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '行政部门编号',
  `partment_name` varchar(30) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '行政部门名称',
  `total_price` decimal(10,2) NOT NULL COMMENT '推单金额合计',
  `num` int(11) unsigned NOT NULL COMMENT '推单数',
  `sort_order` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '整站排名',
  `sort_order_in` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '店内排名',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id` (`user_id`),
  KEY `total_price` (`total_price`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='推单排行榜';

-- ----------------------------
-- Records of csc_rank_list
-- ----------------------------

-- ----------------------------
-- Table structure for csc_recommend
-- ----------------------------
DROP TABLE IF EXISTS `csc_recommend`;
CREATE TABLE `csc_recommend` (
  `id` int(5) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `name` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '推荐位名称 ',
  `page` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'home' COMMENT '页面标识',
  `type` int(2) NOT NULL DEFAULT '0' COMMENT '类型 0页面顶部 1页面中部 2页面底部',
  `is_app` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否显示到app',
  `is_wx` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否显示到微信端',
  `is_pc` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否显示到PC端',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序，从低到高顺序排列',
  `remark` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='推荐位信息表';

-- ----------------------------
-- Records of csc_recommend
-- ----------------------------

-- ----------------------------
-- Table structure for csc_recommend_goods
-- ----------------------------
DROP TABLE IF EXISTS `csc_recommend_goods`;
CREATE TABLE `csc_recommend_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `recommend_id` int(5) NOT NULL COMMENT '推荐位ID',
  `goods_id` int(11) NOT NULL,
  `add_time` datetime DEFAULT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='推荐位关联商品信息表';

-- ----------------------------
-- Records of csc_recommend_goods
-- ----------------------------

-- ----------------------------
-- Table structure for csc_sale_fold_up
-- ----------------------------
DROP TABLE IF EXISTS `csc_sale_fold_up`;
CREATE TABLE `csc_sale_fold_up` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `sale_id` int(11) unsigned NOT NULL COMMENT '营销方案编号',
  `min_price` decimal(8,2) NOT NULL COMMENT '单件商品最低金额',
  `num` tinyint(4) NOT NULL DEFAULT '1' COMMENT '单个商品购买件数',
  `rate` decimal(3,3) NOT NULL COMMENT '折扣点 0-1',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '类型 0单件折上折 1组合折上折 2递进式折上折',
  `is_coupon` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否可用优惠券 0不可用 1可用',
  PRIMARY KEY (`id`),
  KEY `sale_id` (`sale_id`),
  KEY `min_price` (`min_price`),
  KEY `type` (`type`),
  KEY `num` (`num`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='营销方案折上折设置';

-- ----------------------------
-- Records of csc_sale_fold_up
-- ----------------------------

-- ----------------------------
-- Table structure for csc_sale_info
-- ----------------------------
DROP TABLE IF EXISTS `csc_sale_info`;
CREATE TABLE `csc_sale_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `sale_id` int(11) unsigned NOT NULL COMMENT '营销方案编号',
  `brand_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '品牌编号',
  `cate_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '分类编号',
  `rate` decimal(3,2) NOT NULL DEFAULT '1.00' COMMENT '折扣点 0-1',
  `rate_price` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '折扣基准价 0原价 1美起价',
  `cut_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '减免金额',
  `min_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '最小金额',
  `is_coupon` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否可用优惠券 0不可用 1可用',
  PRIMARY KEY (`id`),
  KEY `sale_id` (`sale_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='营销方案打折/满减细则';

-- ----------------------------
-- Records of csc_sale_info
-- ----------------------------

-- ----------------------------
-- Table structure for csc_sale_policy
-- ----------------------------
DROP TABLE IF EXISTS `csc_sale_policy`;
CREATE TABLE `csc_sale_policy` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '策略名称',
  `description` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '描述',
  `scene` tinyint(1) NOT NULL DEFAULT '0' COMMENT '场景 0普通下单 1店铺下单 2推单',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '方案类别 0打折 1满减',
  `rate` decimal(3,3) unsigned NOT NULL DEFAULT '0.999' COMMENT '折扣点 0-1',
  `rate_price` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '折扣基准价 0原价 1美起价',
  `cut_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '减免金额',
  `min_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '最小金额',
  `rate_zero` decimal(3,2) DEFAULT NULL COMMENT '零界点设置 最低折扣 只用于打折  废弃字段',
  `is_coupon` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否可用优惠券 0不可用 1可用',
  `start_time` datetime NOT NULL COMMENT '开始时间',
  `end_time` datetime NOT NULL COMMENT '结束时间',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `scene` (`scene`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='营销方案';

-- ----------------------------
-- Records of csc_sale_policy
-- ----------------------------

-- ----------------------------
-- Table structure for csc_sale_rate_area
-- ----------------------------
DROP TABLE IF EXISTS `csc_sale_rate_area`;
CREATE TABLE `csc_sale_rate_area` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `sale_id` int(11) unsigned NOT NULL COMMENT '营销方案编号',
  `store_area` enum('','mm','lc') COLLATE utf8_unicode_ci NOT NULL COMMENT '店铺区域',
  `rate` decimal(3,3) NOT NULL DEFAULT '0.999' COMMENT '折扣点 0-1',
  `is_coupon` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否可用优惠券 0不可用 1可用',
  PRIMARY KEY (`id`),
  KEY `sale_id` (`sale_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='营销方案区域折扣';

-- ----------------------------
-- Records of csc_sale_rate_area
-- ----------------------------

-- ----------------------------
-- Table structure for csc_sale_special
-- ----------------------------
DROP TABLE IF EXISTS `csc_sale_special`;
CREATE TABLE `csc_sale_special` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `sale_id` int(11) unsigned NOT NULL COMMENT '营销方案编号',
  `brand_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '品牌编号',
  `cate_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '分类编号',
  `goods_list` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '产品ID 多个逗号隔开',
  PRIMARY KEY (`id`),
  KEY `sale_id` (`sale_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='营销方案特例品设置(不参与打折/满减)';

-- ----------------------------
-- Records of csc_sale_special
-- ----------------------------

-- ----------------------------
-- Table structure for csc_score_log
-- ----------------------------
DROP TABLE IF EXISTS `csc_score_log`;
CREATE TABLE `csc_score_log` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `vipcard_id` int(11) NOT NULL COMMENT 'VIP会员卡ID',
  `sysuser_id` int(11) NOT NULL DEFAULT '0' COMMENT '系统用户编号',
  `order_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '订单编号',
  `shop_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '商场/门店名称',
  `score` int(11) NOT NULL COMMENT '变动积分',
  `total_score` int(11) NOT NULL COMMENT '会员卡当前剩余积分',
  `resorce` enum('weixin_mp','ios_pad','ios_phone','android_pad','android_phone','rtg','xilian') COLLATE utf8_unicode_ci NOT NULL COMMENT '来源',
  `log` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '描述',
  `add_time` datetime NOT NULL COMMENT '时间',
  PRIMARY KEY (`id`),
  KEY `vipcard_id` (`vipcard_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='用户积分日志信息表';

-- ----------------------------
-- Records of csc_score_log
-- ----------------------------

-- ----------------------------
-- Table structure for csc_shipping
-- ----------------------------
DROP TABLE IF EXISTS `csc_shipping`;
CREATE TABLE `csc_shipping` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `store_id` int(11) DEFAULT NULL COMMENT '店铺 ID',
  `ship_code` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '配送代码',
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '配送方式名称',
  `description` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '配送方式简介',
  `first_price` decimal(10,2) DEFAULT '0.00' COMMENT '首件邮费',
  `step_price` double NOT NULL DEFAULT '0' COMMENT '附加邮费',
  `cod_regions` text COLLATE utf8_unicode_ci COMMENT '货到付款地址',
  `is_enabled` tinyint(4) NOT NULL COMMENT '是否开启',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序数字',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='配送方式信息表';

-- ----------------------------
-- Records of csc_shipping
-- ----------------------------

-- ----------------------------
-- Table structure for csc_ship_address
-- ----------------------------
DROP TABLE IF EXISTS `csc_ship_address`;
CREATE TABLE `csc_ship_address` (
  `id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL COMMENT '用户ID ',
  `is_default` tinyint(1) NOT NULL DEFAULT '0' COMMENT '默认收货地址 0 不是 1 是',
  `province_id` int(11) NOT NULL COMMENT '省份ID',
  `city_id` int(11) NOT NULL COMMENT '城市ID',
  `area_id` int(11) DEFAULT NULL COMMENT '区县ID',
  `address` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '地址',
  `contactor` varchar(15) COLLATE utf8_unicode_ci NOT NULL COMMENT '联系人',
  `phone` varchar(13) COLLATE utf8_unicode_ci NOT NULL COMMENT '联系电话',
  `id_card` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '身份证',
  `sort` int(11) DEFAULT '0' COMMENT '排序数字 默认为0',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `sort` (`sort`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='会员常用收货地址信息表';

-- ----------------------------
-- Records of csc_ship_address
-- ----------------------------

-- ----------------------------
-- Table structure for csc_sms_code
-- ----------------------------
DROP TABLE IF EXISTS `csc_sms_code`;
CREATE TABLE `csc_sms_code` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `phone` char(13) COLLATE utf8_unicode_ci NOT NULL COMMENT '手机号码',
  `code` char(6) COLLATE utf8_unicode_ci NOT NULL COMMENT '短信校验码',
  `type` tinyint(1) NOT NULL COMMENT '类型 0登录 1注册 2找回密码 3发卡 4绑卡',
  `expries` datetime NOT NULL COMMENT '过期时间',
  `use_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '使用状态 -1已取消 0未验证 1已验证',
  `use_time` datetime DEFAULT NULL COMMENT '使用时间',
  `user_id` int(11) DEFAULT NULL COMMENT '用户ID',
  `add_time` datetime NOT NULL COMMENT '修改或添加日期',
  PRIMARY KEY (`id`),
  KEY `phone` (`phone`),
  KEY `use_status` (`use_status`),
  KEY `type` (`type`)
) ENGINE=InnoDB AUTO_INCREMENT=59 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='短信验证码信息表';

-- ----------------------------
-- Records of csc_sms_code
-- ----------------------------

-- ----------------------------
-- Table structure for csc_sms_queue
-- ----------------------------
DROP TABLE IF EXISTS `csc_sms_queue`;
CREATE TABLE `csc_sms_queue` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `phone` char(13) COLLATE utf8_unicode_ci NOT NULL COMMENT '手机号码',
  `content` varchar(500) COLLATE utf8_unicode_ci NOT NULL COMMENT '短信内容',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '短信发送状态 -2取消发送 -1发送失败 0未发送 1发送成功',
  `is_lock` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否锁定发送状态',
  `send_time` datetime DEFAULT NULL COMMENT '发送时间',
  `error_num` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '发送错误次数',
  `error_time` datetime DEFAULT NULL COMMENT '最近发送错误时间',
  `user_id` int(11) DEFAULT NULL COMMENT '用户ID',
  `sms_id` int(11) DEFAULT NULL COMMENT '短信验证记录编号',
  `result` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '短信发送结果信息',
  `add_time` datetime NOT NULL COMMENT '修改或添加日期',
  PRIMARY KEY (`id`),
  KEY `add_time` (`add_time`)
) ENGINE=InnoDB AUTO_INCREMENT=59 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='短信队列信息表';

-- ----------------------------
-- Records of csc_sms_queue
-- ----------------------------

-- ----------------------------
-- Table structure for csc_store
-- ----------------------------
DROP TABLE IF EXISTS `csc_store`;
CREATE TABLE `csc_store` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT ' 用户编号',
  `invite_user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '邀请人编号',
  `name` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT '店铺名称',
  `content` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '店铺描述',
  `store_phone` char(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '店铺电话',
  `province_id` int(11) NOT NULL DEFAULT '0' COMMENT '省份ID',
  `city_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '城市ID',
  `area_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '区县ID',
  `address` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '店铺详情地址',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '店铺审核状态 默认0 -1已关闭 0待审核 1审核通过',
  `reason` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '审核/关闭原因',
  `mcreate` datetime DEFAULT NULL COMMENT '店铺信息变更日期',
  `sort` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '排序数字 默认1',
  `banner` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '店铺banner',
  `logo` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '店铺logo',
  `is_real` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0虚拟店铺 1实体店铺',
  `add_time` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id` (`user_id`),
  KEY `is_real` (`is_real`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='门店/店铺信息表';

-- ----------------------------
-- Records of csc_store
-- ----------------------------

-- ----------------------------
-- Table structure for csc_store_goods
-- ----------------------------
DROP TABLE IF EXISTS `csc_store_goods`;
CREATE TABLE `csc_store_goods` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `store_id` int(11) unsigned NOT NULL COMMENT '店铺编号',
  `goods_id` int(11) unsigned NOT NULL COMMENT '商品编号',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '排序数字',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `store_id` (`store_id`),
  KEY `sort` (`sort`)
) ENGINE=InnoDB AUTO_INCREMENT=56 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='店铺商品';

-- ----------------------------
-- Records of csc_store_goods
-- ----------------------------

-- ----------------------------
-- Table structure for csc_sysrole
-- ----------------------------
DROP TABLE IF EXISTS `csc_sysrole`;
CREATE TABLE `csc_sysrole` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '角色名',
  `power_id` text COLLATE utf8_unicode_ci COMMENT '权限列表 控制器名称-方法名|控制器名称-方法名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='角色信息表';

-- ----------------------------
-- Records of csc_sysrole
-- ----------------------------

-- ----------------------------
-- Table structure for csc_sysuser
-- ----------------------------
DROP TABLE IF EXISTS `csc_sysuser`;
CREATE TABLE `csc_sysuser` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户名，唯一',
  `tname` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '真实姓名',
  `phone` varchar(13) COLLATE utf8_unicode_ci NOT NULL COMMENT '手机号码',
  `password` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '密码',
  `role_id` int(11) NOT NULL COMMENT '角色ID',
  `locked` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT '是否锁定 默认为0  0 未锁定 1已锁定',
  `reg_time` datetime NOT NULL COMMENT '注册日期',
  `login_time` datetime NOT NULL COMMENT '最近一次登录日期',
  `login_ip` char(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '最近登录IP',
  `ware_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属仓库编号',
  `add_time` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user` (`user`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='用户信息表(后台用户)';

-- ----------------------------
-- Records of csc_sysuser
-- ----------------------------

-- ----------------------------
-- Table structure for csc_user
-- ----------------------------
DROP TABLE IF EXISTS `csc_user`;
CREATE TABLE `csc_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户名',
  `phone` varchar(13) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '手机号码',
  `email` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '邮箱',
