  `pwd` char(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '密码',
  `login_time` datetime DEFAULT NULL COMMENT '上一次登录日期',
  `login_ip` char(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '上一次登录IP',
  `is_lock` int(1) NOT NULL DEFAULT '0' COMMENT '是否锁定 默认0 0 未锁定 1 锁定',
  `reg_time` datetime NOT NULL COMMENT '注册日期',
  `reg_ip` char(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '注册IP',
  PRIMARY KEY (`id`),
  KEY `user` (`user`),
