DROP TABLE IF EXISTS `csc_user_coupon`;
CREATE TABLE `csc_user_coupon` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `coupon_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '优惠券ID',
  `coupon_sn` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0' COMMENT '优惠券编码',
  `source` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '来源 0用户领取 1后台发放 2系统发放',
  `use_status` tinyint(1) unsigned DEFAULT '0' COMMENT '优惠券使用状态 0未使用 1已使用',
  `used_time` datetime DEFAULT NULL COMMENT '使用时间',
  `order_id` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '订单编号',
  `name` varchar(60) COLLATE utf8_unicode_ci NOT NULL COMMENT '名称',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '抵扣金额',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '发送方式 0用户 1部分用户 2注册 3订单金额(购买) 4分享有礼 5生日 6积分兑换',
  `min_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '订单最小金额',
  `use_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '使用期限类型 1指定时间内有效 2立即生效',
  `order_price` int(11) NOT NULL DEFAULT '0' COMMENT '订单单金额',
  `use_start_date` date DEFAULT NULL COMMENT '使用开始日期',
  `use_end_date` date DEFAULT NULL COMMENT '使用结束日期',
  `use_day` smallint(5) unsigned DEFAULT '0' COMMENT '使用有效期时长 单位:天',
  `remark` text COLLATE utf8_unicode_ci COMMENT '备注',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`)
