-- ----------------------------
-- Table structure for csc_work_order
-- ----------------------------
DROP TABLE IF EXISTS `csc_work_order`;
CREATE TABLE `csc_work_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `wo_sn` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '工单编号',
  `order_id` char(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单号',
  `type` tinyint(3) unsigned NOT NULL COMMENT '工单类型 。1：用户下单成功，未付款取消订单；2：用户付款付款成功，申请取消订单并退款；3：用户下单后，15分钟未付款，系统自动取消订单；4：客服手动在后台取消订单（用户下单后，未付款时）；5：客服手动在后台取消订单（用户下单并支付成功后）；6：售后时，客人申请退货；7：售后时，用户申请换货 不需要补差价 8：换货 用户支付差价 9：换货 退还客户差价 10：系统操作部分退款',
  `new_order_id` char(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '换货订单编号',
  `user_id` int(11) NOT NULL COMMENT '用户编号',
  `total_price` decimal(10,2) DEFAULT NULL,
  `sysuser_id` int(11) DEFAULT NULL COMMENT '客户编号',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '工单状态默认0 -1取消 0等待审核 10审核不通过 20审核通过 30工单完成',
  `description` varchar(1000) COLLATE utf8_unicode_ci NOT NULL COMMENT '描述 用户提交',
  `remark` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注。后台操作填写',
  `img_list` varchar(1200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '图片列表 多个逗号隔开',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `wo_sn` (`wo_sn`),
  KEY `order_id` (`order_id`),
  KEY `type` (`type`),
  KEY `status` (`status`),
  KEY `add_time` (`add_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='客服工单信息表';

