DROP TRIGGER IF EXISTS `update_goods_img_thumb_add`;
DELIMITER ;;
CREATE TRIGGER `update_goods_img_thumb_add` AFTER INSERT ON `csc_goods_spec` FOR EACH ROW begin

-- 更新sku 图片信息到goods表
DECLARE img_url varchar(200);

SET img_url = (SELECT img_thumb FROM csc_goods_spec WHERE goods_id = new.goods_id AND stock >0 AND is_enable = 1 ORDER BY price ASC LIMIT 0,1);

UPDATE csc_goods SET img_thumb = img_url WHERE id = new.goods_id;

end
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_goods_img_thumb_up`;
DELIMITER ;;
CREATE TRIGGER `update_goods_img_thumb_up` AFTER UPDATE ON `csc_goods_spec` FOR EACH ROW begin

-- 更新sku 图片信息到goods表
DECLARE img_url varchar(200);

SET img_url = (SELECT img_thumb FROM csc_goods_spec WHERE goods_id = old.goods_id AND stock >0 AND is_enable = 1 ORDER BY price ASC LIMIT 0,1);

UPDATE csc_goods SET img_thumb = img_url WHERE id = old.goods_id;

end
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_goods_img_thumb_del`;
DELIMITER ;;
CREATE TRIGGER `update_goods_img_thumb_del` AFTER DELETE ON `csc_goods_spec` FOR EACH ROW begin

-- 更新sku 图片信息到goods表
DECLARE img_url varchar(200);

SET img_url = (SELECT img_thumb FROM csc_goods_spec WHERE goods_id = old.goods_id AND stock >0 AND is_enable = 1 ORDER BY price ASC LIMIT 0,1);

UPDATE csc_goods SET img_thumb = img_url WHERE id = old.goods_id;

end
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `order_commision_update`;
DELIMITER ;;
CREATE TRIGGER `order_commision_update` AFTER UPDATE ON `csc_order` FOR EACH ROW begin
declare order_commision float;
declare profit_total float;
declare profit_price float;
declare profit_wait float;

if new.commision != old.commision and new.type=1 then
   
   select sum(commision) into order_commision from csc_order_goods where order_id = new.id group by order_id;

   update csc_order set commision = order_commision where id = new.id;
   
  if new.push_user_id != 0 then
     -- 更新userinfo 
     select sum(commision) into profit_total from csc_order where push_user_id = new.push_user_id;
     select sum(commision) into profit_price from csc_order where push_user_id = new.push_user_id and commision_enable = 1;
     select sum(commision) into profit_wait from csc_order where push_user_id = new.push_user_id and commision_enable = 0;
     update csc_user_info set profit_total = profit_total, profit_price = profit_price, profit_wait = profit_total where user_id = new.push_user_id;
   end if;

end if;


end
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `order_goods_commision_add`;
DELIMITER ;;
CREATE TRIGGER `order_goods_commision_add` AFTER INSERT ON `csc_order_goods` FOR EACH ROW begin

-- 新增订单商品提成汇总至订单主表
declare commision_sum float;

set commision_sum=(select sum(commision) from csc_order_goods where order_id=new.order_id);

update csc_order set commision=commision_sum where id=new.order_id;

end
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `order_goods_commision_up`;
DELIMITER ;;
CREATE TRIGGER `order_goods_commision_up` AFTER UPDATE ON `csc_order_goods` FOR EACH ROW begin

-- 修改订单商品提成汇总至订单主表
declare commision_sum float;

set commision_sum=(select sum(commision) from csc_order_goods where order_id=old.order_id);

update csc_order set commision=commision_sum where id=old.order_id;

end
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `order_goods_commision_del`;
DELIMITER ;;
CREATE TRIGGER `order_goods_commision_del` AFTER DELETE ON `csc_order_goods` FOR EACH ROW begin

-- 删除订单商品提成汇总至订单主表
declare commision_sum float;

set commision_sum=(select sum(commision) from csc_order_goods where order_id=old.order_id);

update csc_order set commision=commision_sum where id=old.order_id;

end
;;
